dependencies:
 - name: aceEditor
   version: 0.1.0
   src: htmlwidgets
   stylesheet: aceEditor.css
 - name: indent
   version: 0.3.5
   src: htmlwidgets/indent
   script: indent.min.js
 - name: prettier
   version: 2.1.2
   src: htmlwidgets/prettier
   script:
    - standalone.js
    - parser-babel.js
    - parser-html.js
    - parser-markdown.js
    - parser-postcss.js
    - parser-typescript.js
    - parser-yaml.js
 - name: jQuery
   version: 3.5.1
   src: htmlwidgets/jQuery
   script: jquery.min.js
 - name: sweetalert2
   version: 10.5.1
   src: htmlwidgets/sweetalert2
   script: sweetalert2.min.js
   stylesheet: sweetalert2.min.css
